import React from "react";

const CheckoutSuccessPage = () => {
  return (
    <React.Fragment>
      <div className="checkout-success-container">
        <h1>Checkout Successful!</h1>
        <p>Return to Home</p>
      </div>
    </React.Fragment>
  );
};

export default CheckoutSuccessPage;
